import React, {Component} from 'react';


class TableRow extends Component {
    
    render() {
        return (
           <tr>
               <td>
                   {this.props.obj.name}
               </td>
               <td>
                   {this.props.obj.phone}
               </td>
               <td>
                   {this.props.obj.nic}
               </td>
               <td>
                   {this.props.obj.station}
               </td>
           </tr>
        );
    }
}

export default TableRow;
